// components/Navbar.jsx
import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="w-full bg-gray-900 shadow-lg p-4">
      <div className="container mx-auto flex justify-between items-center">
        <h1 className="text-2xl font-bold text-white">E-Waste Management</h1>
        <div className="flex space-x-6">
          <Link to="/" className="text-gray-300 hover:text-white transition-colors duration-300">Home</Link>
          <Link to="/login" className="text-gray-300 hover:text-white transition-colors duration-300">Login</Link>
          <Link to="/signup" className="text-gray-300 hover:text-white transition-colors duration-300">Signup</Link>
        </div>
      </div> 
    </nav>
  );
}

export default Navbar;
